import {Container, Button, Img} from "./cardStyle";
import styles from './card.module.css';
export default function Card(props) {
   return (
      <Container>
         <Button onClick={props.onClose}>X</Button>
         <div className={styles["image-container"]}></div>
         <h2 className={styles.name}>{props.name}</h2>
         <h2 className={styles.status}>{props.status}</h2>
         <h2 className={styles.species}>{props.species}</h2>
         <h2 className={styles.gender}>{props.gender}</h2>
         <h2 className={styles.origin}>{props.origin}</h2>
         <Img src={props.image} alt='' />
      </Container>
   );
}
